import React from 'react'
import { BrowserRouter, Switch, Route } from 'react-router-dom'
import HOME from './core/Home'


const Routes = ()=> {
    return (
       <BrowserRouter>
           <Switch>
               <Route path="/" exact component={HOME} />
           </Switch>
       </BrowserRouter>
    )
}

